import React from 'react';
import styled from 'styled-components';
const StyledBar = styled.div`
        position: relative;
        height: ${({ height }) => `${height}px`};
        width: 12px;
        background-color: teal;
        display: inline-block;
        margin: 0 1px;
`;
const Bar = ({height}) => {
    return <StyledBar height = {height} />;
};

export default Bar;
